import './PhotoSingle.css';
import { FontAwesomeIcon } from '@fortawesome/react-fontawesome';
import {faWindowClose} from '@fortawesome/free-solid-svg-icons';
const PhotoSingle = () => {
    return(
        <div className="photo-single">
            <div className='photo' id={showPhotos}>
                <span className='close-icon' onClick={searchClose}>
                    <FontAwesomeIcon icon={faWindowClose}></FontAwesomeIcon>
                </span>
                <span className='photo-count'>{photoCountNum} of 6</span>
            </div>
        </div>
    )
}
export default PhotoSingle;
